import React from "react";
import { Link } from 'react-router-dom';


function ArtistsCardStaticThree(props) {
    return (
        <div class="card  text-black">
            <img class="card-img-top" src="StaticImages/s.jpeg" alt="artistsPic" />
            <div class="card-header">



                <Link to={`/artists/artistspage/staticinstance3`}>{props.ArtistsName}</Link>
            </div>
            <div class="card-header">{props.Genre}</div>
            <div class="card-body p-5">{props.VenueList}</div>

        </div>


    );

}

export default ArtistsCardStaticThree;
